        .loadBalancer(true)
        .build());

ApplicationLoadBalancer loadbalancer = ApplicationLoadBalancer.Builder.create(stack, "LB").vpc(vpc).internetFacing(true).build();

service.registerLoadBalancer("Loadbalancer", loadbalancer);

app.synth();

